#
# Solution using prefix sums.
#
from typing import List

class Solution:
    def shiftDistance(self, s: str, t: str, nextCost: List[int], previousCost: List[int]) -> int:
        rpfx_nc = [None for _ in range(26)]
        rpfx_pc = [None for _ in range(26)]
        for i in range(26):
            rpfx_nc[i] = 0 if i == 0 else rpfx_nc[i-1] + nextCost[i-1]
            rpfx_pc[i] = 0 if i == 0 else rpfx_pc[i-1] + previousCost[i-1]

        lpfx_nc = [None for _ in range(26)]
        lpfx_pc = [None for _ in range(26)]
        for i in range(25, -1, -1):
            lpfx_nc[i] = 0 if i == 25 else lpfx_nc[i+1] + nextCost[i+1]
            lpfx_pc[i] = 0 if i == 25 else lpfx_pc[i+1] + previousCost[i+1]

        res = 0
        for x, y in zip(s, t):
            i = ord(x) - 97
            j = ord(y) - 97
            if i == j:
                continue
            if i < j:
                forward_cost = rpfx_nc[j] - rpfx_nc[i]
                backward_cost = rpfx_pc[i+1] + lpfx_pc[j]
            elif j < i:
                forward_cost = lpfx_nc[i] + nextCost[i] + rpfx_nc[j]
                backward_cost = lpfx_pc[j] - lpfx_pc[i]
            res += min(forward_cost, backward_cost)
        return res

